import { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';

import Banner from "../../componentes/projetosApresentacao/projetos-inicio";
import ContatoForms from "../../componentes/contatoForms";

export default function PaginaContato() {
  useEffect(() => {
    AOS.init({
      duration: 1000,
      once: true,
    });
  }, []);

  return (
    <section>
      <Banner data-aos="fade-up" data-aos-delay="100" />
      <ContatoForms data-aos="fade-up" data-aos-delay="300" />
    </section>
  );
}
